import React from 'react';
import './style.css';

function Contactme() {
    return(
        <div className="row">
            <div className="col-l12">
                <div className="social-media" style={{textAlign: "center", padding: "20px 0px 20px 0px", fontSize: "50px"}}>
                    <a id="aboutmelink" href="https://www.linkedin.com/in/patrick-kennedy-262198170/" target="_blank"><i className="fab fa-linkedin-in"></i></a>
                </div>
                <div>
                    <h2 className='title'>pkennedytx1@gmail.com</h2>
                </div>
            </div>
        </div>
    )
}

export default Contactme;
